	(159, 1684960432, 1, 'BE', 1, 0, 5, 'tx_news_domain_model_news', '{"uid":5,"pid":8,"tstamp":1684960432,"crdate":1684960432,"cruser_id":1,"t3ver_oid":0,"t3ver_wsid":0,"t3ver_state":0,"t3ver_stage":0,"t3_origuid":0,"editlock":0,"sys_language_uid":0,"l10n_parent":0,"l10n_diffsource":"","l10n_source":0,"deleted":0,"hidden":0,"starttime":0,"endtime":0,"fe_group":"","notes":"","l10n_state":null,"t3ver_id":0,"t3ver_label":"","t3ver_count":0,"t3ver_tstamp":0,"t3ver_move_id":0,"sorting":0,"title":"Le\\u00a0lorem ipsum\\u00a0(\\u00e9galement appel\\u00e9\\u00a0faux-texte","teaser":"Le\\u00a0lorem ipsum\\u00a0(\\u00e9galement appel\\u00e9\\u00a0faux-texte,\\u00a0lipsum, ou\\u00a0bolo bolo1) est, en\\u00a0imprimerie, une suite de mots sans signification utilis\\u00e9e \\u00e0 titre provisoire pour\\u00a0calibrer\\u00a0une\\u00a0mise en page, le texte d\\u00e9finitif venant remplacer le faux-texte d\\u00e8s qu\'il est pr\\u00eat ou que la mise en page est achev\\u00e9e.","bodytext":"<p>Le&nbsp;<em><strong>lorem ipsum<\\/strong><\\/em>&nbsp;(\\u00e9galement appel\\u00e9&nbsp;<strong>faux-texte<\\/strong>,&nbsp;<em><strong>lipsum<\\/strong><\\/em>, ou&nbsp;<strong>bolo bolo<\\/strong><sup><a href=\\"https:\\/\\/fr.wikipedia.org\\/wiki\\/Lorem_ipsum#cite_note-1\\">1<\\/a><\\/sup>) est, en&nbsp;<a href=\\"https:\\/\\/fr.wikipedia.org\\/wiki\\/Imprimerie\\" title=\\"Imprimerie\\">imprimerie<\\/a>, une suite de mots sans signification utilis\\u00e9e \\u00e0 titre provisoire pour&nbsp;<a href=\\"https:\\/\\/fr.wikipedia.org\\/wiki\\/Mise_en_page#M%C3%A9thodes_de_mise_en_page\\" title=\\"Mise en page\\">calibrer<\\/a>&nbsp;une&nbsp;<a href=\\"https:\\/\\/fr.wikipedia.org\\/wiki\\/Mise_en_page\\" title=\\"Mise en page\\">mise en page<\\/a>, le texte d\\u00e9finitif venant remplacer le faux-texte d\\u00e8s qu\'il est pr\\u00eat ou que la mise en page est achev\\u00e9e.<\\/p>\\r\\n<p>G\\u00e9n\\u00e9ralement, on utilise un texte en faux&nbsp;<a href=\\"https:\\/\\/fr.wikipedia.org\\/wiki\\/Latin\\" title=\\"Latin\\">latin<\\/a>&nbsp;(le texte ne veut rien dire, il a \\u00e9t\\u00e9 modifi\\u00e9), le&nbsp;<em>Lorem ipsum<\\/em>&nbsp;ou&nbsp;<em>Lipsum<\\/em>. L\'avantage du latin est que l\'op\\u00e9rateur sait au premier coup d\'\\u0153il que la page contenant ces lignes n\'est pas valide et que l\'attention du lecteur n\'est pas d\\u00e9rang\\u00e9e par le contenu, lui permettant de demeurer concentr\\u00e9 sur le seul aspect graphique.<\\/p>\\r\\n<p>Il circule des centaines de versions diff\\u00e9rentes du&nbsp;<em>lorem ipsum<\\/em>, mais ce texte aurait originellement \\u00e9t\\u00e9 tir\\u00e9 de l\'ouvrage \\u00e9crit par&nbsp;<a href=\\"https:\\/\\/fr.wikipedia.org\\/wiki\\/Cic%C3%A9ron\\" title=\\"Cic\\u00e9ron\\">Cic\\u00e9ron<\\/a>&nbsp;en 45&nbsp;av. J.-C.,&nbsp;<em><a href=\\"https:\\/\\/fr.wikipedia.org\\/wiki\\/De_finibus_bonorum_et_malorum\\" title=\\"De finibus bonorum et malorum\\">De finibus bonorum et malorum<\\/a><\\/em>&nbsp;(<em>Liber Primus<\\/em>, 32), texte populaire \\u00e0 cette \\u00e9poque, dont l\'une des premi\\u00e8res phrases est&nbsp;:&nbsp;\\u00ab&nbsp;Neque porro quisquam est qui do<strong>lorem ipsum<\\/strong>&nbsp;quia&nbsp;<strong>dolor sit amet<\\/strong>,&nbsp;<strong>consectetur<\\/strong>,&nbsp;<strong>adipisci<\\/strong>&nbsp;v<strong>elit<\\/strong>\\u2026&nbsp;\\u00bb&nbsp;(\\u00ab&nbsp;Il n\'existe personne qui aime la souffrance pour elle-m\\u00eame, ni qui la recherche ni qui la veuille pour ce qu\'elle est\\u2026&nbsp;\\u00bb).<\\/p>","datetime":1684960369,"archive":0,"author":"","author_email":"","categories":1,"related":0,"related_from":0,"related_files":null,"fal_related_files":0,"related_links":0,"type":"0","keywords":"","description":"","tags":0,"media":null,"fal_media":0,"internalurl":null,"externalurl":null,"istopnews":0,"content_elements":0,"path_segment":"le-lorem-ipsum-egalement-appele-faux-texte","alternative_title":"","sitemap_changefreq":"","sitemap_priority":"0.5","import_id":"","import_source":""}', 0, '0400$0305d1a6f27a0fb40a3fb531d8f3bfc8:bc83755a03cca2ca5c8daa03e9d6e32e'),
